import "./App.css";
import Overview from "./components/Overview.js"
import Cards from "./components/Cards.js"

function App() {

  const Cursor = () => {
    return <div className="cursor"/>
  }


  return (
    <div>
      <Cursor/>
      <Overview></Overview>
      <Cards></Cards>
    </div>
    
  )
}

export default App;
